import React, {Component} from 'react';
import {Bar, Line, Pie} from 'react-chartjs-2';
import nav from './nav';

class Performance extends Component {
    constructor(props) {
        super(props);
        this.state = {
            performanceChartData: {
                labels: ['Boston', 'SpringField', 'Lowell'],
                datasets:[
                    {
                        label: 'Performance of System',
                        data: [
                           617594,
                           156789,
                           234124
                        ],
                        backgroundColor: [
                           'rgba(255, 99, 132, 0.6)',
                           'rgba(54, 162, 235, 0.6)',
                           'rgba(255, 206, 86, 0.6)'
                        ]
                    }
                ]
            }
        }
    }

    render() {
        return (
            <div className="PerformanceChart">
                <nav />
                <Bar
                    data={this.state.performanceChartData}
                    options={{
                        maintainAspectRatio: false
                    }}
                />      
            </div>
        )
    }
}

export default Performance;
